import { useState } from "react";
import "./Counter.css";

function Counter() {
  let [num, setNum] = useState(0);
  let increase = () => {
    setNum(num + 1);
  };

  function Decrease() {
    let [localNum, setLocalNum] = useState(0);
    let decreaseBtn = () => {
      setLocalNum(localNum - 1);
    };
  }

  return (
    <div className="container">
      <h1 className="head">{num}</h1>
      <button onClick={increase} className="increaseBtn">
        increase
      </button>
      <button onClick={decreaseBtn} className="decreaseBtn">
        decrease
      </button>
    </div>
  );
}

export default Counter;
